// import "react-native-gesture-handler";
import React from "react";
import {
  StyleSheet,
  Text,
  View,
  TextInput,
  TouchableOpacity,
  Button
} from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { createDrawerNavigator } from "@react-navigation/drawer";
import Icon from "react-native-vector-icons/Ionicons";
import Login from "./screens/login";
import Sign from "./screens/signUp";
import Home from "./bottomTab/home";
import Account from "./bottomTab/accountScreen";
import Budget from "./bottomTab/budget";
import Manage from "./bottomTab/manage";
import Spending from "./bottomTab/spending";
import Forgot from "./screens/forgot";
import { ScrollView } from "react-native-gesture-handler";

const Tab = createBottomTabNavigator();
const chart_wh = 250;
const series = [123, 321, 123, 789, 537];
const sliceColor = ["#F44336", "#2196F3", "#FFEB3B", "#4CAF50", "#FF9800"];
var total = 0;

function ProfileScreen({ navigation }) {
  return (
    <ScrollView>
      <Account />
      <View style={styles.container2}>
        <TouchableOpacity
          style={styles.loginBtn}
          onPress={() => {
            alert("Logging Out");
            navigation.navigate("Login");
          }}
        >
          <Text style={styles.loginText}>Log Out</Text>
        </TouchableOpacity>
      </View>
    </ScrollView>
  );
}
const drawer = createDrawerNavigator();

function Drawer() {
  return (
    <drawer.Navigator initialRouteName="">
      <drawer.Screen name="Return" component={ProfileScreen} />
      <drawer.Screen name="Sign.Out" component={Login} />
    </drawer.Navigator>
  );
}

function MyTabs() {
  return (
    <Tab.Navigator
      initialRouteName="Home"
      tabBarOptions={{
        showIcon: true,
        activeTintColor: "#000",
        inactiveTintColor: "#fff",
        style: {
          backgroundColor: "#68A047",
          position: "absolute",
          left: 0,
          bottom: 0,
          right: 0
        }
      }}
    >
      <Tab.Screen
        name="Budget"
        component={Budget}
        options={{
          headerShown: false
        }}
        NavigationOptions={{
          tabBarIcon: ({ tintColor }) => (
            <Icon name="Icon" size={30} color="#900" />
          )
        }}
      />
      <Tab.Screen
        name="Manage"
        component={Manage}
        options={{
          headerShown: false
        }}
      />
      <Tab.Screen
        name="Home"
        component={homeScreen}
        options={{
          headerShown: false
        }}
      />
      <Tab.Screen
        name="Spending"
        component={Spending}
        options={{
          headerShown: false
        }}
      />
      <Tab.Screen name="Profile" component={Drawer} headerMode="none" />
    </Tab.Navigator>
  );
}

function SignUpScreen({ navigation }) {
  return (
    <View style={styles.container1}>
      <Sign />
      <View style={styles.signUpButton}>
        <TouchableOpacity
          style={styles.loginBtn}
          onPress={() => {
            navigation.navigate("MyTabs");
            alert("Signed Up!");
          }}
        >
          <Text style={styles.loginText}>Sign Up!</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

function homeScreen({ navigation }) {
  return (
    <View>
      <View>
        <Home />
      </View>
      <View style={styles.Home}>
        <TouchableOpacity onPress={() => navigation.navigate("Manage")}>
          <Text style={styles.navBudget}>Manage Budget</Text>
        </TouchableOpacity>
        <TouchableOpacity onPress={() => navigation.navigate("Spending")}>
          <Text style={styles.navBudget}>View Spending</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
}

function ForgotPassword({ navigation }) {
  return (
    <View style={styles.container1}>
      <Forgot />
    </View>
  );
}

function LoginScreen({ navigation }) {
  return (
    <View style={styles.container}>
      <View>
        <Login />
      </View>
      <TouchableOpacity onPress={() => navigation.navigate("ForgotPassword")}>
        <Text style={styles.forgot}>Forgot Password?</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.loginBtn}
        onPress={() => {
          navigation.navigate("MyTabs");
          alert("Logging In");
        }}
      >
        <Text style={styles.loginText}>LOGIN</Text>
      </TouchableOpacity>
      <TouchableOpacity onPress={() => navigation.navigate("SignUp")}>
        <Text style={styles.SignUp}>Sign Up</Text>
      </TouchableOpacity>
    </View>
  );
}

const Stack = createStackNavigator();

export default class App extends React.Component {
  render() {
    return (
      <NavigationContainer>
        <Stack.Navigator initialRouteName="Login">
          <Stack.Screen
            name="Login"
            component={LoginScreen}
            options={{
              headerShown: false,
              title: "LogIn",
              headerMode: "none",
              headerStyle: { backgroundColor: "#68A047" },
              headerTitleStyle: {
                fontWeight: "bold",
                fontStyle: "italic",
                fontSize: 20,
                color: "#68A047"
              }
            }}
          />
          <Stack.Screen
            name="SignUp"
            component={SignUpScreen}
            options={{
              title: "",
              fontSize: 35,
              headerStyle: { backgroundColor: "#68A047" }
            }}
          />
          <Stack.Screen
            name="ForgotPassword"
            component={ForgotPassword}
            options={{
              title: "",
              fontSize: 35,
              headerStyle: { backgroundColor: "#68A047" }
            }}
          />

          <Stack.Screen
            name="MyTabs"
            component={MyTabs}
            options={{
              headerShown: false,
              title: "Budget Manager Pro",
              headerStyle: {
                backgroundColor: "#68A047"
              },
              headerTitleStyle: {
                fontWeight: "bold",
                fontStyle: "italic",
                fontSize: 20,
                color: "white"
              }
            }}
          />
        </Stack.Navigator>
      </NavigationContainer>
      // <View style={styles.container}>
      //   {/* <Navigator /> */}
      //   <Login />
      //   {/* <Sign /> */}
      //   {/* <Home /> */}
      // </View>
    );
  }
}
